webpackJsonp([0x9ae090ad674b],{1521:function(n,t){n.exports={data:{markdownRemark:{html:'<p>Không có nghề nào nhảy việc dữ dội bằng cái nghề IT này, điều đó được chứng mình qua việc nghề IT của anh chúng ta đa ra hẳn một cái mảng gọi là "buôn bán nhân lực ngành IT - ITViec.com"</p>\n<p>Nay muốn đem một đề tài để có thể cùng thảo luận, những câu hỏi nào mọi người từng được hỏi mà cảm thấy thú vị nhất khi đi phỏng vấn (không bao gồm các câu hỏi kỹ thuật)</p>\n<p>Mình từng được hỏi những câu như thế này</p>\n<blockquote>\n<p>Tại sao em chọn học React</p>\n</blockquote>\n<blockquote>\n<p>Tại sao em chọn làm Frontend mà không phải Backend</p>\n</blockquote>\n<blockquote>\n<p>Anh không biết gì về UX, như một người bạn em có thể tóm tắt lại những nguyên tắc chung nhất khi làm ux là gì không</p>\n</blockquote>\n<blockquote>\n<p>Nếu em và đồng nghiệp cãi nhau em sẽ làm gì</p>\n</blockquote>\n<blockquote>\n<p>Em thích công việc ổn định, hay chọn công việc làm bất kể ngày đêm</p>\n</blockquote>\n<blockquote>\n<p>Em thích nghe nhạc nào, bài hát mới nhất của họ là gì</p>\n</blockquote>\n<blockquote>\n<p>Bạn cảm thấy thành công nhất dự án lần trước bạn làm là gì, điều khiến bạn tự hào ở dự án đó</p>\n</blockquote>\n<blockquote>\n<p>Bạn học được gì trong dự án gần đây nhất</p>\n</blockquote>\n<blockquote>\n<p>Khó khăn lớn nhất ở dự án mà bạn đã từng gặp</p>\n</blockquote>\n<p>Một vài câu lụm được trên mạng của đồng môn</p>\n<blockquote>\n<p>Hàm yêu thích nhất trong excel của em là gì</p>\n</blockquote>\n<blockquote>\n<p>Em ghét nhất gì ở công ty anh</p>\n</blockquote>\n<blockquote>\n<p>Em thấy thế nào là hard work</p>\n</blockquote>\n<p>Không biết mọi người có nhận được câu hỏi nào thú vị nữa không, comment bên dưới nhé.</p>',timeToRead:1,excerpt:"Không có nghề nào nhảy việc dữ dội bằng cái nghề IT này, điều đó được chứng mình qua việc nghề IT của anh chúng ta đa ra hẳn một cái mảng…",frontmatter:{title:"Những câu hỏi thú vị bạn từng được hỏi khi phỏng vấn",cover:"",date:"2019-10-13",category:null,tags:["javascript"],desc:"Thảo luận quanh chủ đề câu hỏi không khó nhưng thú vị trong lúc phỏng vấn"},fields:{slug:"/2019-10-13-nhung-cau-hoi-thu-vi-trong-interview"}}},pathContext:{slug:"/2019-10-13-nhung-cau-hoi-thu-vi-trong-interview",prev:{frontmatter:{title:"Viết câu điều kiện tốt hơn trong javascript",desc:"Xem xét một trong những câu lệnh được sử dụng nhiều nhất trong lập trình: câu điều kiện",type:"post",category:null,tags:["javascript"],date:"2019-10-13",cover:""},fields:{slug:"/2019-10-13-viet-cau-dieu-kien-trong-javascript"}},next:{frontmatter:{title:"Sử dụng flat state trong Vue Store",desc:"Nhét những tập dữ liệu lớn trong Vuex store, đặc biệt là các cấu trúc dữ liệu lồng nhau luôn gây ra vấn đề không sớm thì muộn. Bài viết giới thiệu cách tiếp cận với flat state trong Vuex store",type:"post",category:null,tags:["vuejs"],date:"2019-10-12",cover:"https://alligator.io/images/vuejs/testing-vue-with-jest.png"},fields:{slug:"/2019-10-12-flat-state-trong-vue-store-de-toi-uu-toc-do"}}}}}});
